import React, { Component } from "react";

class App extends Component {
    state = {
        exercises: [
            { id: 1, title: "Bench Press" },
            { id: 2, title: "Deadlift" },
            { id: 3, title: "Squats" }
        ],
        title: ""
    };

    render() {
        return (
            <>
                <div>Hello</div>
            </>
        );
    }
}

export default App;
